from typing import  *
class Solution:
    def longestStrChain(self, words: List[str]) -> int:
        words.sort(key=lambda v: len(v))
        l = set([len(i) for i in words])
        if len(l) == 1:
            return 1
        f = [0 for i in range(len(words))]
        alphas = [chr(i) for i in range(ord('a'), ord('z') + 1)]

        def is_access(parent, son):
            """
             a 是 b 的祖先
            """
            nonlocal alphas
            if len(parent)+1 != len(son):
                return False
            lack = set(list(son)) - set(list(parent))
            if len(lack) > 1:
                return False
            for a in set(list(son)):
                for j in range(0, len(parent)+1):
                    w = parent[:j] + a + parent[j:]
                    if w == son:
                        return True
            return False

        for i in range(0, len(f)):
            f[i] = 1
            for j in range(1, i + 1):
                if len(words[i]) > (len(words[i - j])+1):
                    break
                if is_access(words[i - j], words[i]):
                    f[i] = max(f[i], f[i - j] + 1)
        return max(f)


